INSERT INTO `modularSite` (`id`, `page`, `content`, `image`, `AbsoluteLinkPicture`, `AbsoluteLinkPicture2`, `CSS_Internal`) VALUES
(1, 'home', '<h2>This site is about fishing</h2>\r\n<p>Data coming from table moduleSite</p>\r\n<p>Living in upstate NY provides excellent fishing locations - Fishing in Florida in the summer is also fantastic</p>\r\n<span class=\"Important\">Jim\'s favorite fishing spots</span>\r\n<ul style=\"list-style-type: square;\">\r\n<li>Lake Erie</li>\r\n<li>Lake Ontario</li>\r\n<li>Finger Lakes</li>\r\n<li>Lake Tarpon is situated in North Pinellas County in FL<br/> Lake Tarpon regarded as one of the top sport fishing lakes in Florida. It is renowned for its trophy-sized largemouth bass; ten-pound bass are not an unusual catch!</li>\r\n</ul>', , 'https://', NULL, '');
INSERT INTO `modularSite` (`id`, `page`, `content`, `image`, `AbsoluteLinkPicture`, `AbsoluteLinkPicture2`, `CSS_Internal`) VALUES
(2, 'people', '<h3>Local fishing charters</h3>\r\n<p>Data from modularSite table</p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><a href=\"http://www.captaingenebassfishing.com/\">Captain Gene Goldman</a></li>\r\n<li><a href=\"https://www.acecharters.com/\">Ace Charters</a></li>\r\n<li><a href=\"http://www.fishdoctorcharters.com/\">Fish Doctor Charters</a></li>\r\n</ul>', NULL, 'https://', NULL, ''),
(3, 'tour', '<h3>Fly Fishing Reports and Conditions</h3>\r\n<p>Data from modularSite table</p>\r\n<p>Welcome to the most complete report of fly fishing conditions in North America. Our professional reports are updated weekly with stream and river flows, tides, recommended flies and equipment, and special fishing tips for the most important fly-fishing destinations in North America.</p>\r\n<p><a href=\"http://www.orvis.com/s/fishingreports/5879\">http://www.orvis.com/s/fishingreports/5879</a><p>', NULL, 'https://', NULL, ''),
